// src/components/Worker Dashboard/TrainingPage.js
import React from 'react';

const TrainingPage = () => {
  return (
    <div className="page-container">
      <h2>Training</h2>
      <p>This is where company-related information will go.</p>
    </div>
  );
};

export default TrainingPage;
